		function addHoverScale(target, scaleMultiplier = 1.2, duration = 200) { // default unless specifed otherwise
		    // Store original scale
		    const originalScaleX = target.scaleX;
		    const originalScaleY = target.scaleY;
		    
		    // Add hover listeners
		    target.on("mouseover", function() {
		        createjs.Tween.get(target)
		            .to({
		                scaleX: originalScaleX * scaleMultiplier, 
		                scaleY: originalScaleY * scaleMultiplier
		            }, duration, createjs.Ease.quadOut);
		    });
		    
		    target.on("mouseout", function() {
		        createjs.Tween.get(target)
		            .to({
		                scaleX: originalScaleX, 
		                scaleY: originalScaleY
		            }, duration, createjs.Ease.quadOut); // quadout
		    });
		}
		
		
		
